import React from 'react';

var sectionStyle = {
    backgroundImage: "url(./images/pic01.jpg)"
  };

const Tile = ({title,description,url}) => {

    return (<article style={sectionStyle}>
        <span className="image">
            <img src={url} alt="" />
        </span>
        <header className="major">
            <h3><a href={"/" + title.toLowerCase()} className="link">{title}</a></h3>
            <p>{description}</p>
        </header>
    </article>);
}

export default Tile;
